def _get_time_bins(self, ax):
        if not isinstance(ax, DatetimeIndex):
            raise TypeError(
                "axis must be a DatetimeIndex, but got "
                f"an instance of {type(ax).__name__}"
            )

        if len(ax) == 0:
            binner = labels = DatetimeIndex(data=[], freq=self.freq, name=ax.name, tz=ax.tz)
            return binner, [], labels

        first, last = ax[[0, -1]]
        first = first.tz_localize(None)
        last = last.tz_localize(None) + get_base_and_stride(last)

        if self.label == 'left':
            last -= get_base_and_stride(self.freq)
        else:
            first += get_base_and_stride(self.freq)

        # It is possible first == last if an AmbiguousTimeError is
        # raised in the first place. The reason comes down to how the
        # indices are created. For let's say '2018-11-04 00:00:00',
        # since this is an ambiguous time, it gets shifted forward to
        # '2018-11-04 01:00' timezone.
        if first == last:
            if self.label == 'left':
                first -= get_base_and_stride(self.freq)
            else:
                last += get_base_and_stride(self.freq)

        binner = date_range(start=first, end=last, freq=self.freq, tz=ax.tz, name=ax.name, closed=self.closed)

        ax_values = binner.astype('int64').values

        binner, bin_edges = self._adjust_bin_edges(binner, ax_values)

        # general version, knowing nothing about relative frequencies
        bins = lib.generate_bins_dt64(ax_values, bin_edges, self.closed, has_nans=ax.hasnans)

        if self.closed == "right":
            labels = binner
            if self.label == "right":
                labels = labels[1:]
        elif self.label == "right":
            labels = labels[1:]

        if ax.hasnans:
            binner = binner.insert(0, NaT)
            labels = labels.insert(0, NaT)

        # if we end up with more labels than bins
        # adjust the labels
        if len(bins) < len(labels):
            labels = labels[: len(bins)]

        return binner, bins, labels
